}

class googleForm {  // 구글폼에 전체 양식을 업로드할 수 있음.
    constructor (public form : entireForm){} 
    //생성자 인자는 원래 접근할 수 없지만 아래에서 사용할것이므로 public 사용
}

let firstResume : entireForm = {    // 첫번째 이력서는 전체 양식을 따랐음.
    name : "Junseong Park",
    age : 27,
    career : "Apple, Yahoo",
    tel : 123-1234
}

let passedResume = new googleForm(firstResume)  // 합격 이력서는 구글폼에 올렸던 첫번째 이력서임.
console.log(`A passed resume is ${passedResume.form.name}'s `) // 합격 이력서에서 이름을 추출해 발표함.

// 추상클래스로도 사용가능 (여러 클래스의 부모가 되는 가상 클래스 역할)

interface Tax { 
    // 인터페이스 생성 : 실행되는 부분없이 선언부만 있는 클래스라고 생각하면 됨 (그냥 있다고 말하고 그 기능은 정의하지않음.)
    calc (money : number) : number
}

class Employees {   // 부모가될 클래스
    constructor () {
        console.log("I'm an employee")
    }

}

class Senior extends Employees implements Tax { // 인터페이스와 클래스를 모두 상속받는 클래스

    calc (money : number) : number  {
        console.log("I'm a senior developer")
        return money * 0.05
    }
}

class Junior implements Tax {   // 인터페이스만 상속받는 클래스

    calc (money : number ) : number {
        console.log("I'm a junior developer")
        return money * 0.03
    }
}

let p1 = new Senior
let money1 = 40000000
console.log(p1.calc(money1))

let p2 = new Junior
let money2 = 30000000
console.log(p2.calc(money2))

list/java/class.html.body:
클래스, setter, getter
package Score;

public class Student {
    private String name;
    public int score;

    public Student(String name, int score){ 
        this.name = name; 
        this.score = score; 
    }

    public void getinfo() { 
        System.out.printf("%s 학생의 점수는 %d점 입니다.\n", name, score); 
    } 

    public String getName() { 
        return name; 
    } 

    public void setName(String name) { 
        this.name = name; 
    }    
}

위 코드는 Student 클래스를 정의한 코드입니다.

외부에서 접근할 수 없는 String 변수인 name과 어디서든 접근할 수 있는 int 변수인 score를 가지고 있습니다.

생성자를 통해 이 클래스는 name과 score를 인자로 받아 클래스 내부에서 사용합니다.

getinfo 메서드를 호출하면 학생의 이름과 점수가 출력됩니다.

name 변수는 외부에서 직접 접근할 수 없지만, setName과 getName 메서드를 통해 값을 변경할 수 있고 반환받을 수도 있습니다.


package Score; 

public class Main { 
    public static void main(String[] args) { 
        Student st1 = new Student("Jun", 90); 
        Student st2 = new Student("Yul", 100); 

        st1.getinfo(); 
        st2.getinfo(); 

        st1.name = "JJ"; //여긴 private라 변경불가 
        st1.score = 100; 

        st1.setName("JJJ"); 

        System.out.println(st1.getName()); 
    } 
}

메인함수를 살펴보겠습니다.

Student 클래스의 st1 인스턴스는 "Jun" 이라는 이름과 90이라는 점수를 가지고 있습니다.

st2 인스턴스는 "Yul" 이라는 이름과 100이라는 점수를 가지고 있습니다.

이후 getinfo 메서드를 호출하여 정보를 얻었습니다.

name 변수는 private변수이기때문에 st1.name 처럼 직접 접근할 수 없습니다.

이때 setName, getName 메서드를 통해 값을 설정하고 출력할 수 있습니다.

list/java/interface.html.body:
인터페이스
package inter; 

public interface interfaceA { 
    public void funcA(); 
}

package inter; 

public interface interfaceB { 
    public void funcB(); 
}

인터페이스는 내용의 프로토타입만 나타내지, 정의는 구현 클래스에서 한다.
설명서에 하는 방법은 나와있는데 용어의 의미는 다른곳에서 찾는것을 생각하면 된다.
참고로 여기 있는 메소드들은 구현되지 않았다고 해서 추상메소드라고 한다.
package inter; 

public class interfaceOperator implements interfaceA, interfaceB { 
    public interfaceOperator() { 
        System.out.println("Constructor is operating."); 
    } 

    public void funcA() { 
        System.out.println("funcA was called"); 
    } public void funcB() { 
        System.out.println("funcB was called"); 
    } 
}

위 코드는 인터페이스를 구현하는 코드이다. 상속은 하나의 클래스만 가능하지만 여러개의 인터페이스를 구현할 수 있다.
인터페이스 구현체의 생성자를 정의하고 인터페이스에서 볼 수 있던 메서드의 내용을 포함하고 있다.
package inter; 

public class Main { 
    public static void main(String[] args) { 
        interfaceA inta = new interfaceOperator(); 
        interfaceB intb = new interfaceOperator(); 

        inta.funcA(); 
        intb.funcB(); 
    } 
}

메인함수에서 인터페이스의 인스턴스를 선언했다.
인터페이스명 인스턴스명 = new 구현체 순으로 작성하여 선언함.
람다식
package inter; 

public class Main { 
    public static void main(String[] args) { 
        interfaceA inta = (int a, int b) -> {System.out.println("Hi")}; 
    } 
}

인터페이스 구현체에서 메서드 내용을 정의하지 않고 메인함수에서 화살표를 이용해 정의하는 것을 람다식이라고 한다.

list/java/inherit.html.body:
상속
package inherit; 

public class parent { 
    public parent() { 
        System.out.println("constructor of parent"); 
    } 

    public void sayOh() {
         System.out.println("Oh"); 
    } 
    private void sayNo() { 
        System.out.println("No"); 
    }
}


부모 클래스를 먼저 정의함. parent 클래스의 생성자를 추가했으며 2개의 메소드를 추가함.

참고로, sayNo 메서드는 private로 선언되어있기에 자식 클래스가 상속받아 사용할 수 없음.


오버라이드
package inherit; 

public class child extends parent{ 
    public child() { 
        System.out.println("constructor of child"); 
    } 

    public void sayOh() { 
        System.out.println("OHHHHHHHHHHHHHHH");
    } 
}


자식 클래스는 extends 키워드를 통해 parent 클래스를 상속받았음.

기존에 parent 클래스에 있던 sayOh 메서드를 자식 클래스에서 다시 정의했으며 이를 오버라이딩이라고 함.

이때 child 클래스는 오버라이딩한 sayOh 메서드를 사용하게 된다.


package inherit; 

public class Main { 
    public static void main(String[] args) {
        parent first = new child(); 
        parent second = new secondchild(); 

        parent[] arr = new parent[2]; 
        arr[0] = first; 
        arr[1] = second; 
    } 
}


first와 second는 모두 parent 자료형이기에 배열로 만들 수 있다. 

위 코드의 의미는 parent 자료형인 first 인스턴스를 만들며 이는 child 생성자를 사용한다는 것이다.

두 번째 코드는 모두 같지만 secondchild 생성자를 사용하는 것이다.


Object 클래스, this, super

모든 클래스의 조상 클래스는 Object 클래스이므로 모든 클래스가 이 클래스를 상속한다.
this는 지금 속한 클래스를, super는 지금 속한 클래스의 부모 클래스를 가리킨다.

내부클래스
OuterClass.InnerClass ic = new OuterClass.InnerClass();

내부 클래스는 클래스 안에 클래스가 있는 것이다.
익명 클래스
AnonymousClass sampleClass = new AnonymousClass(); 
new AnonymousClass();


보통 첫번째 줄처럼 클래스의 인스턴스를 생성한다. 두 번째 줄은 익명 클래스 선언방법이다.

자료형과 인스턴스의 이름이 없음을 알 수 있다. 보통 메서드 오버라이딩 후 바로 접근하여 사용할때 사용된다. (아래 코드 참고)


new parent(){ 
    public void sayHo() { 
        System.out.println("Override"); 
    }.sayHo();

익명 클래스는 인터페이스와 추상 클래스와 자주 사용된다.

list/java/static.html.body:
package Wallet; 

public class Wallet { 
    static int money = 0; 

    public void saveMoney(int money) { 
        this.money += money; 
        System.out.printf("현재 적립금은 %d원 입니다.\n", this.money); 
    } 
}

package Wallet; 

public class Main { 
    public static void main(String[] args) { 
    Wallet first = new Wallet(); 
    Wallet second = new Wallet(); 

    first.saveMoney(5000); 
    second.saveMoney(100000); 
    } 
}


money 변수에 static 이 없다고 가정했을때, first 계좌에는 5000, second 계좌에는 10000원이 있어야함.

하지만 money를 static 변수로 선언했다면 이 변수는 모든 인스턴스들이 공유하는 변수가됨.

즉, first 계좌에서 5000원이 적립되고, second 계좌에서 10000원을 추가해서 105000원이 적립됨.

list/java/abs.html.body:
package abs; 

public abstract class addonClass { 
    public abstract void funcABS(); 
}

abstract 키워드를 이용해 추상 클래스를 생성한다. 

추상 클래스는 추상 메서드를 가질 수 있다는 점을 제외하면 일반 클래스와 다를게 없다.

추상 메서드를 던져주면 자식 클래스에서 정의하는 형식임.

참고로 super(a,b)처럼 super키워드를 사용하면 자식 클래스에서 입력받고 부모 클래스로 값을 전송할 수 있음.



package abs; 

public class originClass extends addonClass { 
    public void funcABS() { 
        System.out.println("Hello"); 
    } 
}

부모 클래스에서 받은 추상 메서드를 자식 클래스에서 반드시 구현해야한다.
package abs; 

public class main { 
    public static void main(String[] args) { 
        addonClass test = new originClass(); 
        test.funcABS(); 
    } 
}


추상클래스는 대분류에 속하지만, 인스턴스의 형태가 가지각색일때 사용해야한다.

Animal 클래스의 자식 클래스인 Dog, Bird, Shark 등은 속성과 메소드가 워낙 다양하므로 Animal 클래스는 추상 클래스로 정의되어야 한다.

A기업의 지역별 체인점의 정책이 가지각색이라면 A기업의 클래스는 추상 클래스여야 한다.

list/java/string.html.body:
StringBuffer, StringBuilder
package test; 

public class Hello { 
    public static void main(String[] args) { 
        String str = "JAVA"; 
        str = str+ "_8"; 

        StringBuffer sb = new StringBuffer("JAVA"); 
        sb.append("_8"); 

        StringBuilder sbuild = new StringBuilder("JAVA");
        sbuild.append("_8"); 
    } 
}


기존에 있던 문자열 str에 문자열을 추가하면 해당 메모리에 데이터가 추가되는것이 아니라 새로운 주소에 모두 합쳐진 데이터가 할당된다. 

그리고 기존 메모리 공간은 GC가 수거해간다. 사실 매우 비효율적이다.

이럴때 StringBuffer, StringBuilder 를 사용하면 그 자리에서 데이터를 추가할 수 있다.


StringBuffer
StringBuffer sb = new StringBuffer("JAVA"); 
sb.append("_8");

StringBuffer는 동기적으로 작동하기때문에 순차적으로 값이 들어오므로 데이터 안정성이 높다.
StringBuilder
StringBuilder sbuild = new StringBuilder("JAVA"); 
sbuild.append("_8");


StringBuilder는 비동기적으로 작동하기에 속도가 빠르지만 안정성이 떨어지는 단점이 있다.

물론 둘의 차이는 체감되는 정도가 아니지만, 최근엔 속도가 중요하기에 StringBuilder를 사용하는 추세임.


ArrayList
package test; 

import java.util.ArrayList; 

public class Hello { 
    public static void main(String[] args) { 
        ArrayList list = new ArrayList(); 

        list.add("Hello"); 
        list.add("JAVA"); 
        list.add("World"); 
        System.out.println(list); 

        list.add(1, "Welcome"); 
        System.out.println(list); 

        list.set(2, "Kotlin"); 
        System.out.println(list); 

        String newLanguage = list.get(2); 
        System.out.println(newLanguage); 

        list.remove(1); 
        System.out.println(list); 
    } 
}


ArrayList는 사이즈를 표기하지 않기에 크기가 유동적이다. 

그리고 인덱스를 통해 원하는 위치에 값을 추가, 변경, 추출, 제거를 할 수 있다.


HashMap
package test; 

import java.util.HashMap; 

public class Hello { 
    public static void main(String[] args) { 
        HashMap map = new HashMap(); 

        map.put(5, "Hello"); 
        map.put(6, "JAVA"); 
        map.put(7, "World"); 
        System.out.println(map); 

        map.put(6, "Kotlin"); 
        System.out.println(map); 

        String lang = map.get(6); 
        System.out.println(lang); 
    } 
}

HashMap은 키-값 쌍을 가진 데이터의 집합이다.
